oxy_webhelp_navlinks = {"azr_file_indexing-d22908e18248":{"topics":[{"title":"Performing file indexing for a specific snapshot","shortdesc":"<p class=\"shortdesc\">Perform file indexing for a snapshot of an Azure virtual machine or managed disk for         enabling file recovery.<\/p>","href":"saas\/azr_performing_file_indexing.html","attributes":{"data-id":"azr_performing_file_indexing"},"menu":{"hasChildren":false},"tocID":"azr_performing_file_indexing-d22908e18261","topics":[]},{"title":"Managing file indexing for all available snapshots","shortdesc":"<p class=\"shortdesc\">Manage file indexing for Azure virtual machines or managed disks by turning on or         turning off file indexing. Turning on file indexing facilitates quick file recovery by         allowing you to search across indexed snapshots and initiate recovery without waiting for         file indexing to complete. When it is no longer needed, you can turn off file         indexing.<\/p>","href":"saas\/azr_managing_file_indexing.html","attributes":{"data-id":"azr_managing_file_indexing"},"menu":{"hasChildren":false},"tocID":"azr_managing_file_indexing-d22908e18272","topics":[]},{"title":"File recovery limitations","shortdesc":"<p class=\"shortdesc\">File indexing and recovery have certain limitations.<\/p>","href":"saas\/azr_limitations.html","attributes":{"data-id":"azr_limitations"},"menu":{"hasChildren":false},"tocID":"azr_limitations-d22908e18283","topics":[]},{"title":"Indexing limitations","shortdesc":"<p class=\"shortdesc\">Information about the file systems supported for indexing in <span class=\"ph\">RSC<\/span>.<\/p>","href":"saas\/filesystems_indexing_limitations_3.html","attributes":{"data-id":"fs_ondemand_indexing_limitations"},"menu":{"hasChildren":false},"tocID":"fs_ondemand_indexing_limitations-d22908e18294","topics":[]}]}};